import React from 'react'
import Register from './components/Register'
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function PageRouter() {
    return (
        <Router>
        <>
            <Switch>
            <Route exact path='/register' component={Register} />
            </Switch>
        </>
        </Router>
    )
}

export default PageRouter
